import React, { useContext } from "react";
import {DataTable} from "primereact/datatable";
import {Column} from "primereact/column";
import {Panel} from "primereact/panel";
import { EmpleadoContext } from "../contexts/EmpleadoContext";

const EmpleadoList = () => {

    const {empleados} = useContext(EmpleadoContext);

    return (<div>
 <Panel header="React CRUD JS" style={{width:'80%', marginTop:'20px', margin:'0 auto'}}>
        <DataTable value={empleados}>
          <Column field="id" header="ID"></Column>
          <Column field="nombreCompleto" header="Empleado"></Column>
          <Column field="puesto" header="Correo"></Column>
          <Column field="salario" header="Correo"></Column>
          <Column field="estatus" header="Correo"></Column>
          <Column field="fechaContratacion" header="Correo"></Column>
        </DataTable>
      </Panel>
    </div>);
}

export default EmpleadoList;
